                        life place to enjoy life.
                    </p>
                    <p className="parraph"> FRANCO MOLINA </p>
                    <p className="parraph"> CEO of Las Salinas </p>
                </Stack>

                <Box
                    sx={{
                        gridColumn: { xs: "4 / span 5", md: "4 / span 5" },
                        overflow: "hidden",
